import React from "react";
import Button from "react-bootstrap/Button";

function Buttons() {
  return <Button variant="outline-secondary" size="lg" style={ButtonStyle}></Button>;
}


const ButtonStyle ={
    borderRadius: "3px",
    color: "inherit",
    display: "inline-block",
    width: "100px",
    height: "40px"
}
export default Buttons;
